INSERT INTO `config` (`id`, `key`, `value`, `created_at`, `updated_at`) VALUES
(1, 'help', 'Menu Kriteria \nPada menu kriteria peneliti dapat melihat kriteria-kriteria kesesuain lahan bawang putih yang terdiri dari beberapa sumber. \n\nMenu Basis Aturan\nPada menu basis aturan peneliti bawang putih dapat melihat rules pada Kabupaten Magetan dan Kabupaten Solok dalam menentukan kesesuaian lahan bawang putih. \nMetode digunakan : Spatial Decision Tree \nJumlah aturan pada Kab Magetan : 44 Rules\nJumlah aturan pada Kab Solok       : 66 Rules\n\nMenu Klasifikasi \nPada menu klasifikasi\nProses prediksi kesesuaian lahan bawang putih  melalui tahapan sebagai berikut:\n\nInput Data --> Cek Rule --> Klasifikasi \n1. Data diinputkan dengan field relief, \n2. Setelah data diinputkan, tiap record dari atribut dan testing akan di cocokkan dengan rules atau aturan yang terbentuk. \n3. bila data yang diiputkan mempunyai record yang sama dengan rule diatas makan akan terklasifikasi menjadi kesesuaian lahan \"S1(Sangat Sesuai), S2(Cukup Sesuai), S3(Sesuai Marginal), N(Tidak Sesuai) dan Unclassified.', '2020-05-05 22:26:07', '2020-05-07 00:07:05');
